/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `check_comment_user_movie_exists` BEFORE INSERT ON `comment` FOR EACH ROW BEGIN
    IF NOT EXISTS(SELECT * FROM `user` WHERE `user_id` = NEW.`user_id`) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'The user referenced in the comment does not exist';
    END IF;
    IF NOT EXISTS(SELECT * FROM `movie` WHERE `movie_id` = NEW.`movie_id`) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'The movie referenced in the comment does not exist';
    END IF;
END */;;
