CREATE TABLE `movie` (
  `movie_id` int NOT NULL AUTO_INCREMENT,
  `title_movie` varchar(255) NOT NULL,
  `release_date` int DEFAULT NULL,
  `Poster_Link` varchar(2000) DEFAULT NULL,
  `movie_description` text,
  `language` varchar(50) DEFAULT 'English',
  `IMDB_Rating` varchar(5) DEFAULT NULL,
  `Runtime` varchar(10) DEFAULT NULL,
  `director_id` int DEFAULT NULL,
  PRIMARY KEY (`movie_id`),
  KEY `director_id` (`director_id`),
  CONSTRAINT `movie_ibfk_1` FOREIGN KEY (`director_id`) REFERENCES `director` (`director_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1000 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
