/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `check_thumb_user_movie_exists` BEFORE INSERT ON `thumb` FOR EACH ROW BEGIN
    IF NOT EXISTS(SELECT * FROM `user` WHERE `user_id` = NEW.`user_id`) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'The user referenced in the thumb does not exist';
