    IF NOT EXISTS(SELECT * FROM `movie` WHERE `movie_id` = NEW.`movie_id`) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'The movie referenced in the thumb does not exist';
    END IF;
END */;;
