CREATE DEFINER=`root`@`localhost` PROCEDURE `GetComplexStatistics`()
BEGIN
  -- 1. Calculate the average IMDB rating for each genre
  CREATE TEMPORARY TABLE genre_avg_rating AS
  SELECT g.name_genre, AVG(CAST(m.IMDB_Rating AS DECIMAL(3,1))) as avg_rating
  FROM genre g
  JOIN genre_movie gm ON g.genre_id = gm.genre_id
  JOIN movie m ON gm.movie_id = m.movie_id
  GROUP BY g.name_genre;

  -- 2. Calculate the movie count for each director
  CREATE TEMPORARY TABLE director_movie_count AS
  SELECT d.name as director_name, COUNT(m.movie_id) as movie_count
  FROM director d
  JOIN movie m ON d.director_id = m.director_id
  GROUP BY d.name;

  -- 3. Calculate the movie count for each actor
  CREATE TEMPORARY TABLE actor_movie_count AS
  SELECT a.name as actor_name, COUNT(m.movie_id) as movie_count
  FROM actor a
  JOIN movie_actor ma ON a.actor_id = ma.actor_id
  JOIN movie m ON ma.movie_id = m.movie_id
  GROUP BY a.name;

  -- Return results
  SELECT * FROM genre_avg_rating;
  SELECT * FROM director_movie_count;
  SELECT * FROM actor_movie_count;
  
  -- Clean up temporary tables
  DROP TEMPORARY TABLE genre_avg_rating;
  DROP TEMPORARY TABLE director_movie_count;
  DROP TEMPORARY TABLE actor_movie_count;
END ;;
DELIMITER ;
