CREATE DEFINER=`root`@`localhost` PROCEDURE `GetUserLikesStatistics`(IN user_id INT)
BEGIN
  -- 获取用户喜欢的电影类型及其相应的喜欢时间
  CREATE TEMPORARY TABLE user_likes_genre AS
  SELECT DATE_FORMAT(t.thumb_time, '%Y-%m-%d') AS thumb_date, g.name_genre, COUNT(t.thumb_time) AS likes_count
FROM genre g
JOIN genre_movie gm ON g.genre_id = gm.genre_id
JOIN movie m ON gm.movie_id = m.movie_id
JOIN thumb t ON m.movie_id = t.movie_id
WHERE t.user_id = user_id 
GROUP BY thumb_date, g.name_genre;


  -- 返回结果
  SELECT * FROM user_likes_genre;

  -- 清理临时表
  DROP TEMPORARY TABLE user_likes_genre;
END ;;
