CREATE DEFINER=`root`@`localhost` PROCEDURE `imdbup`()
BEGIN
   SELECT a.movie_id, a.title_movie, a.release_date, a.Runtime, a.Poster_Link, a.language, a.IMDB_Rating, COUNT(DISTINCT t.thumb_id) as num_thumb, e.name_genre as category, GROUP_CONCAT(DISTINCT f.name SEPARATOR ', ') as actors
   FROM (
       SELECT movie_id, title_movie, release_date, Poster_Link, language, IMDB_Rating, Runtime
       FROM movie
       ORDER BY IMDB_Rating DESC
       LIMIT 32
   ) as a
   JOIN movie m ON a.movie_id = m.movie_id
   LEFT JOIN thumb t ON m.movie_id = t.movie_id
   LEFT JOIN genre_movie g ON m.movie_id = g.movie_id
   LEFT JOIN genre e ON e.genre_id = g.genre_id
   LEFT JOIN movie_actor r ON m.movie_id = r.movie_id
   LEFT JOIN actor f ON r.actor_id = f.actor_id
   GROUP BY a.movie_id, a.title_movie, a.release_date, a.Poster_Link, a.language, a.IMDB_Rating, category;
END ;;
