CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_all_data`(
  IN p_Poster_Link VARCHAR(2000),
  IN p_Series_Title VARCHAR(255),
  IN p_Released_Year int,
  IN p_Runtime VARCHAR(10),
  IN p_Genre VARCHAR(30),
  IN p_IMDB_Rating VARCHAR(5),
  IN p_Overview TEXT,
  IN p_Director VARCHAR(255),
  IN p_actor1 VARCHAR(255),
  IN p_actor2 VARCHAR(255),
  IN p_actor3 VARCHAR(255),
  IN p_actor4 VARCHAR(255)
)
BEGIN
  DECLARE v_director_id INT;
  DECLARE v_genre_id INT;
  DECLARE v_movie_id INT;
  DECLARE v_actor_id INT;

  START TRANSACTION; -- 事务开始

  -- Check if the director exists, otherwise insert
  SELECT director_id INTO v_director_id FROM director WHERE name = p_Director;
  IF v_director_id IS NULL THEN
    INSERT INTO director (name) VALUES (p_Director);
    SET v_director_id = LAST_INSERT_ID();
  END IF;

  -- Check if the genre exists, otherwise insert
  SELECT genre_id INTO v_genre_id FROM genre WHERE name_genre = p_Genre;
  IF v_genre_id IS NULL THEN
    INSERT INTO genre (name_genre) VALUES (p_Genre);
    SET v_genre_id = LAST_INSERT_ID();
  END IF;

  -- Insert movie
  INSERT INTO movie (
    title_movie,
    release_date,
    Poster_Link,
    movie_description,
    Runtime,
    IMDB_Rating,
    director_id
  )
  VALUES (
    p_Series_Title,
    p_Released_Year,
    p_Poster_Link,
    p_Overview,
    p_Runtime,
    p_IMDB_Rating,
    v_director_id
  );
  SET v_movie_id = LAST_INSERT_ID();

  -- Associate movie with genre
  INSERT INTO genre_movie (genre_id, movie_id) VALUES (v_genre_id, v_movie_id);

  -- Insert or update the actors
  IF p_actor1 IS NOT NULL THEN
    INSERT INTO actor (name) VALUES (p_actor1);
    SET v_actor_id = LAST_INSERT_ID();
    -- Insert the movie_actor relation
    INSERT INTO movie_actor (movie_id, actor_id) VALUES (v_movie_id, v_actor_id);
  END IF;

  IF p_actor2 IS NOT NULL THEN
    INSERT INTO actor (name) VALUES (p_actor2);
    SET v_actor_id = LAST_INSERT_ID();
    -- Insert the movie_actor relation
    INSERT INTO movie_actor (movie_id, actor_id) VALUES (v_movie_id, v_actor_id);
  END IF;

  IF p_actor3 IS NOT NULL THEN
    INSERT INTO actor (name) VALUES (p_actor3);
    SET v_actor_id = LAST_INSERT_ID();
    -- Insert the movie_actor relation
    INSERT INTO movie_actor (movie_id, actor_id) VALUES (v_movie_id, v_actor_id);
  END IF;

  IF p_actor4 IS NOT NULL THEN
    INSERT INTO actor (name) VALUES (p_actor4) ON DUPLICATE KEY UPDATE actor_id = LAST_INSERT_ID(actor_id);
    SET v_actor_id = LAST_INSERT_ID();
    -- Insert the movie_actor relation
    INSERT INTO movie_actor (movie_id, actor_id) VALUES (v_movie_id, v_actor_id);
  END IF;

  COMMIT; -- 提交事务

END ;;
DELIMITER ;
